CREATE DEFINER=`root`@`localhost` FUNCTION `fn_columna`(idemp int, fec datetime) RETURNS varchar(100) CHARSET latin1
BEGIN
-- --------------------------------------------------------------------------------

declare b varchar(100) default '';
declare e varchar(100) default '';
DECLARE a varchar(100);
DECLARE c varchar(100);
DECLARE cant INT DEFAULT 0;
DECLARE l_last_row INT DEFAULT 0;
declare cursor1 cursor for select date_format(registro,'%H:%i'), date_format(registro,'%Y-%m-%d %H:%i:%s') from registros where idempleados = idemp and 
date_format(registro,'%Y-%m-%d') = fec and date_format(registro,'%Y-%m-%d')=date_format(fechareal,'%Y-%m-%d') or (idempleados = idemp and 
date_format(fechareal,'%Y-%m-%d') = fec)order by registro asc;
DECLARE CONTINUE HANDLER FOR NOT FOUND SET l_last_row=1;
open cursor1;
REPEAT
    FETCH cursor1 INTO b,e;
    IF not l_last_row THEN
		if cant = 0 then 
			set a = b,
			c = e,
			cant = 1;
		else 
			SET a = CONCAT(a, ' // ', b),
			c = CONCAT(c,  e),
			cant = cant + 1;
		end if;
    END IF;   
UNTIL l_last_row END REPEAT;
close cursor1;
	if cant % 2 <> 0 then 
		set a = concat(a, ' ', 'ERROR EN FICHADO');
	END IF;
			if cant = 2 then
				set a = concat(a,' HT: ', timediff(substring(c,20,19),substring(c,1,19) ));
			end if ;
			if cant = 4 then
				set a = concat(a,' HT: ',sec_to_time(time_to_sec(timediff(substring(c,20,19),substring(c,1,19) ))+time_to_sec(timediff(substring(c,58,19),substring(c,39,19) )))),
					a = concat(a,' Ds: ', timediff(substring(c,39,19),substring(c,20,19) ));
