CREATE DEFINER=`root`@`localhost` FUNCTION `fn_feriados`(fec datetime , idemp int) RETURNS varchar(100) CHARSET latin1
BEGIN
declare b varchar(100) default '';
DECLARE a varchar(100);
DECLARE cant INT DEFAULT 0;
DECLARE l_last_row INT DEFAULT 0;
declare cursor1 cursor for select concat('FERIADO:',ltrim(rtrim(f.detalle))) as pepe
 from feriados f where f.fecha=fec
union
select concat(ltrim(rtrim(tn.detalle)),'-',ltrim(rtrim(tdn.detalle)),'-',ltrim(rtrim(n.detalle))) as pepe
	from novedades n 
	left join tiposdenovedades tdn on tdn.idtiposdenovedades=n.idtiposdenovedades
	left join tipodenovedad tn on tn.idtiponovedad=tdn.idtipodenovedad
	where fec >= desde and fec<=hasta and idempleados=idemp or (fec >= desde and fec<=hasta and idempleados=0);

DECLARE CONTINUE HANDLER FOR NOT FOUND SET l_last_row=1;
open cursor1;
REPEAT
    FETCH cursor1 INTO b;
    IF not l_last_row THEN
		if cant = 0 then 
			set a = b,
			cant = 1;
		else 
			SET a = CONCAT(a, ' // ', b),
			cant = cant + 1;
		end if;
    END IF;   
UNTIL l_last_row END REPEAT;
close cursor1;
RETURN a;
END ;;
