CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_registro`(idemple int,mes int,ano int)
BEGIN
SET lc_time_names = 'es_MX';
		select e.nombre as Empleado,concat(date_format(dt_val,'%d/%m/%Y'),' - ',upper(DAYNAME(dt_val))) as Dia, 
		ifnull((select acceso.fn_columna(e.idempleados,dt_val)),'') as Registro ,ifnull((select acceso.fn_feriados(dt_val,e.idempleados)),'') as Novedades, date_format(dt_val,'%d/%m%/%Y') as fecha,ifnull((select acceso.fn_ht(e.idempleados,dt_val)),'') as ht
		from( 
select 
adddate(concat(ano,'-',mes,'-1'), valor) as dt_val 
from( 
select (v2 * 4 + v1) * 4 + v0 as valor from 
(select 0 as v0 union select 1 union select 2 union select 3) as rs0 cross join 
(select 0 as v1 union select 1 union select 2 union select 3) as rs1 cross join 
(select 0 as v2 union select 1 union select 2 union select 3) as rs2 
) as rs 

) as rs2 
left join empleados e on e.documento=idemple
where month(dt_val) = mes
order by dt_val;

END ;;
