CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_registro1`(INI DATETIME, FIN DATETIME)
BEGIN
	
		DROP TABLE IF EXISTS FECHAS;

	create table FECHAS
		Select '0' as idempleados , dt_val
		from ( 
		select 
		date_add(INI, INTERVAL VALOR DAY) as dt_val 
		from( 
		select (v2 * 4 + v1) * 4 + v0 as VALOR from 
		(select 0 as v0 union select 1 union select 2 union select 3) as rs0 cross join 
		(select 0 as v1 union select 1 union select 2 union select 3) as rs1 cross join 
		(select 0 as v2 union select 1 union select 2 union select 3) as rs2 
		) as rs 
		
		) as rs2 
		where dt_val <=fin
		order by dt_val;
		SET lc_time_names = 'es_MX';
		select e.nombre as Empleado,concat(date_format(f.dt_val,'%d/%m/%Y'),' - ',upper(DAYNAME(f.dt_val))) as Dia, 
		ifnull((select acceso.fn_columna(e.idempleados,f.dt_val)),'') as Registro ,ifnull((select acceso.fn_feriados(dt_val,e.idempleados)),'') as Novedades, date_format(f.dt_val,'%d/%m%/%Y') as fecha,ifnull((select acceso.fn_ht(e.idempleados,dt_val)),'') as ht
		from empleados e
		left join fechas f on e.idempleados<>f.idempleados
		where activo=1
		order by e.nombre, f.dt_val;

END ;;
